import {Link} from 'react-router-dom';
import Container from '@mui/material/Container';


function ShowProducts(){
    return(
        <Container maxWidth="sm">
            <Link to='/form' className='btn btn-success  btn-lg mt-2 mb-2 text-white'>Formulario</Link>
            <Link to='/Inicio' className='btn btn-success  btn-lg mt-2 mb-2 text-white'>Inicio</Link>
            <Link to='/Contacto' className='btn btn-success  btn-lg mt-2 mb-2 text-white'>Contacto</Link>
            <Link to='/Nosotros' className='btn btn-success  btn-lg mt-2 mb-2 text-white'>Nosotros</Link>
            <h1>Creando</h1>
        </Container>
    )
}
export default ShowProducts;
